In developing these shorts we ask our subjects to gather as much footage of their lives as they can and then we edit it all together. It’s been a really fun, collaborative way to create short documentaries from the perspective of the subjects and then funneled through our lens. We want to thank @kevinearltaylor @kevinearltaylorstudio and Kevin’s amazing and talented wife Yvonne @ymonstah_yo for all of their hard work and patience putting this piece together. We hope you enjoy it! Lots more to come!
